SELECT POSTCODE
    {# return if any value is true for a given postcode then treat as true
    in postcode grouping (some are duplicated and we need to use this logic) #}
    , MAX(LEADING_LIFESTYLES) AS LEADING_LIFESTYLES
    , MAX(METROTECH) AS METROTECH
    , MAX(ASPIRATIONALS) AS ASPIRATIONALS
    , MAX(HEARTH_HOME) AS HEARTH_HOME
    , MAX(DOING_FINE) AS DOING_FINE
    , MAX(FAIR_GO) AS FAIR_GO
    , MAX(URBAN_ACCESSIBILITY) AS URBAN_ACCESSIBILITY
    , MAX(TRADES) AS TRADES
    , MAX(LARGE_SCALE_HOMEOWNERS) AS LARGE_SCALE_HOMEOWNERS
    , MAX(AFFLUENT_RURAL) AS AFFLUENT_RURAL
FROM mappings
GROUP BY 1
